import React,{useContext} from 'react'
import GuestContext from '../Context/guestContext/guestContext'

function ThemDark() {
    const {backMode} = useContext(GuestContext)

    return (
        <div className="sm:block md:hidden absolute top-0 left-0">
            <div ><i className={`fa fa-align-right text-2xl && ${ backMode === "light"?'text-hover' : 'text-textcolor'}`}></i></div>
        </div>
    )
}

export default ThemDark
